import client from '../util/shopify-client'




const ItemList = () => {
    client.product.fetchAll().then((products) => (
        products.map((item,i) => (
            <div>
                Hello
                {console.log(item.description)}
            </div>
        ))    
    ))

}



const Store = () => {
    return(
        <div style={{
            position:"relative",
            top:"20vh"
        }}>
            Hello there and welcome
            <ItemList />
        </div>
    )
}

export default Store;
